import{_ as e,c as a,o as t,a as r}from"./app.435f75b1.js";const u=JSON.parse('{"title":"Boid Crystal","description":"","frontmatter":{},"headers":[],"relativePath":"elements/crystal.md"}'),i={name:"elements/crystal.md"},s=r('<h1 id="boid-crystal" tabindex="-1">Boid Crystal <a class="header-anchor" href="#boid-crystal" aria-hidden="true">#</a></h1><p>The metallic crystal known as the Boid Crystal. The super rare crystal allows the transmittal and storage of data while providing integral structural strength matched by no other material. The Boid Crystal is considered the holy grail of materials. In every application, the Boid Crystal almost feels alive as it adapts to the task at hand.</p><p>The Boid Crystal is the rarest known element in the known universe. It has outstripped rare metals such as Gold and Platinum and is often what the Nol and Boid alike strive to collect. The Boid Crystal signifies power and wealth.</p><details class="details custom-block"><summary>Details</summary><h4 id="material-characteristics" tabindex="-1">Material Characteristics <a class="header-anchor" href="#material-characteristics" aria-hidden="true">#</a></h4><p>Metallic Crystal.</p><h4 id="geology-geography" tabindex="-1">Geology &amp; Geography <a class="header-anchor" href="#geology-geography" aria-hidden="true">#</a></h4><p>it is commonly found in smaller quantities in geodes found deep within the planet. Very large quantities have been discovered on asteroids.</p><h4 id="origin-source" tabindex="-1">Origin &amp; Source <a class="header-anchor" href="#origin-source" aria-hidden="true">#</a></h4><p>Unknown.</p><h4 id="type" tabindex="-1">Type <a class="header-anchor" href="#type" aria-hidden="true">#</a></h4><p>Metamaterial</p><h4 id="color" tabindex="-1">Color <a class="header-anchor" href="#color" aria-hidden="true">#</a></h4><p>The Boid Crystal is a translucent light blue.</p><h4 id="melting-freezing-point" tabindex="-1">Melting / Freezing Point <a class="header-anchor" href="#melting-freezing-point" aria-hidden="true">#</a></h4><p>The Boid Crystal can sense the users objective and will assist them in their objectives. If a user is trying to forge Boid Crystals the Crystal can adapt to become more usable and easier to forge.</p><h4 id="common-state" tabindex="-1">Common State <a class="header-anchor" href="#common-state" aria-hidden="true">#</a></h4><p>Solid/Crystal</p></details>',4),o=[s];function n(l,d,h,c,p,m){return t(),a("div",null,o)}const g=e(i,[["render",n]]);export{u as __pageData,g as default};
